import { Button, styled } from "@mui/material";
import { red } from "@mui/material/colors";


const CustomButton = (props) => {
  const theme = useTheme(); // Access the theme
  const {
    startIcon,
    endIcon,
    size,
    customStyles,
    fullWidth,
    children,
    ...other
  } = props;
  return (
    <>
      <StyledButton
        size={size}
        fullWidth={fullWidth}
        startIcon={startIcon}
        endIcon={endIcon}
        {...props}
      >
        {props.children || "Sign In"}
      </StyledButton>
    </>
  );
};

export default CustomButton;
